var inputStapling = $("#Stapling")
var inputDuplex = $("#Duplex")
var inputPrintColor = $("#PrintColor")
var previewImage = $("#preview_img")

var imageNormalStaple = "data:image/png;base64,"
var imageDuplexStaple = "data:image/png;base64,"
var imageNormal = "data:image/png;base64,"
var imageDuplex = "data:image/png;base64,"
function updateImage() {
  var stapling = inputStapling.is(':checked')
  var duplex = inputDuplex.is(':checked')
  
  if (stapling == true) {
    if (duplex == true) {
      previewImage.attr("src", imageDuplexStaple);
    } else {
      previewImage.attr("src", imageNormalStaple);
    }
  } else {
    if (duplex == true) {
      previewImage.attr("src", imageDuplex);
    } else {
      previewImage.attr("src", imageNormal);
    }
  }
}

function colorImage() {
  var printColor = inputPrintColor.is(':checked')
  if (printColor == false) {

    previewImage.css({ "filter": "grayscale(100%)" })
  } else {
    previewImage.css({ "filter": "grayscale(0%)" })
  }
}
$(document).ready(updateImage)
$(document).ready(colorImage)
inputStapling.click(updateImage)
inputDuplex.click(updateImage)
inputPrintColor.click(colorImage)


